const canvas = document.createElement('canvas');
const ctx = canvas.getContext('2d');
const img = new Image();

// Use the base64 data URL
const base64String = 'data:image/jpeg;base64,';
img.src = base64String;

function loadImage(crossOrigin = false) {
    if (crossOrigin) {
        img.crossOrigin = "Anonymous";
    } else {
        img.removeAttribute('crossOrigin');
    }
    // The src is already set, so we don't need to set it again here
}

loadImage();

let text = '';
let isTyping = false;
let cursorVisible = true;
let cursorInterval;

img.onload = function() {
    console.log('Image loaded successfully');
    canvas.width = img.width;
    canvas.height = img.height;
    const canvasContainer = document.getElementById('canvas-container');
    canvasContainer.appendChild(canvas);
    canvasContainer.style.width = `${img.width}px`;
    canvasContainer.style.height = `${img.height}px`;
    
    // Set download button width to match the image
    const downloadBtn = document.getElementById('downloadBtn');
    downloadBtn.style.width = `${img.width}px`;
    
    drawImage();  // Draw the image immediately
    startTyping(); // Start typing immediately when the image loads
};

img.onerror = function() {
    console.error('Error loading image:', img.src);
    alert('Error loading image. Please check the base64 string.');
};

// Remove the click event listener for startTyping
// canvas.addEventListener('click', startTyping);

document.addEventListener('keydown', handleKeyPress);

function startTyping() {
    isTyping = true;
    text = '';
    if (!cursorInterval) {
        cursorInterval = setInterval(blinkCursor, 500);
    }
    drawImage();
}

function handleKeyPress(e) {
    if (!isTyping) return;

    if (e.key === 'Enter') {
        isTyping = false;
        stopTyping();
    } else if (e.key === 'Backspace') {
        text = text.slice(0, -1);
    } else if (e.key.length === 1) {
        text += e.key;
    }

    cursorVisible = true; // Reset cursor visibility on each keypress
    drawImage();
}

function blinkCursor() {
    cursorVisible = !cursorVisible;
    drawImage();
}

function drawImage(drawCursor = true) {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.drawImage(img, 0, 0);

    const fontSize = 80;
    ctx.font = `${fontSize}px "Bebas Neue", sans-serif`;
    ctx.fillStyle = 'white';
    ctx.textAlign = 'center';
    ctx.textBaseline = 'middle';

    const x = canvas.width / 2;
    const y = canvas.height * 0.57;

    // Add text shadow
    ctx.shadowColor = 'rgba(0, 0, 0, 0.5)';
    ctx.shadowBlur = 4;
    ctx.shadowOffsetX = 2;
    ctx.shadowOffsetY = 2;

    if (text) {
        ctx.fillText(text, x, y);
    }

    if (drawCursor && isTyping && cursorVisible) {
        const cursorX = x + ctx.measureText(text).width / 2 + 5;
        ctx.fillText('|', cursorX, y);
    }

    // Reset shadow for future drawings
    ctx.shadowColor = 'transparent';
    ctx.shadowBlur = 0;
    ctx.shadowOffsetX = 0;
    ctx.shadowOffsetY = 0;
}

function downloadImage() {
    try {
        // Save the current canvas state
        const currentText = text;
        const currentIsTyping = isTyping;
        const currentCursorVisible = cursorVisible;

        // Temporarily modify the state
        isTyping = false;
        cursorVisible = false;

        // Redraw the canvas without the cursor
        drawImage();

        // Create download link
        const link = document.createElement('a');
        link.href = canvas.toDataURL('image/jpeg');
        link.download = 'image_with_text.jpg';
        link.click();

        // Restore the original state
        text = currentText;
        isTyping = currentIsTyping;
        cursorVisible = currentCursorVisible;

        // Redraw the canvas with the original state
        drawImage();
    } catch (e) {
        console.error('Error downloading image:', e);
        alert('Unable to download the image. Please make sure the image is from the same origin or use a local image file.');
    }
}

// Add this to stop the cursor when typing ends
function stopTyping() {
    isTyping = false;
    if (cursorInterval) {
        clearInterval(cursorInterval);
        cursorInterval = null;
    }
    drawImage();
}

// Add this at the end of the file
document.getElementById('downloadBtn').addEventListener('click', downloadImage);

